import React from "react"

const Freelancer2InnerHeader = () => {
    return(
        <>
            <section className="inner-header-page">
                <div className="container">

                    <h2>Hire The Best UI Specialists</h2>
                    <p>Work with the world’s best talent on Upwork — the top freelancing website trusted by over 5
                        million businesses.</p>

                </div>
            </section>
            <div className="clearfix"></div>
        </>
    );
}
export default Freelancer2InnerHeader
